    "proposed-becharof-wildlife-refuge-headquarters-site-inventory-king-salmon-and-naknek",nt"isopen":
    false,nt"url": null,nt"notes": "As (d)(2) legislation moves through Congress,
    the Refuges and Resource Planning Divisions of the U.S. Fish and Wildlife Service
    office in Anchorage work to prepare for the initial phases of operation of the potential
    new Alaskan wildlife refuges. As part of the Resource Planning Team, I spent several
    weeks gathering written material about the Bristol Bay area in general and the Bristol
    Bay Borough in particular. After this initial familiarization, I spent 3 weeks in
    King Salmon and Naknek to interview local residents and physically investigate the
    local environment. Discussed are physiography, hydrology, climate, flora, fauna,
    plants, birds, mammals, fish, vegetation, soils, and local human development and
    uses. Economic, community infrastructure, and transportation needs are also discussed.",nt"license_title":
